import React from "react";
import { NavbarWrapper, NavbarItem } from "./Navbar.styles";

const Navbar = () => {
  return (
    <NavbarWrapper>
      <NavbarItem>About</NavbarItem>
      <NavbarItem>Skills</NavbarItem>
      <NavbarItem>Contacts</NavbarItem>
    </NavbarWrapper>
  );
};

export default Navbar;
